import { useState } from 'react';
import axios from 'axios';

function UserLoginForm() {

  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const LoginUser = async (e) => {
    e.preventDefault();
    const payload = { email,password };
    try {
      const response = await axios.post('http://localhost:4580/api/login', payload,{
        headers:{
          authorization:'Be'
        }
      });
      console.log(response.data);
    } catch (error) {
      console.error('Error creating login:', error);
    }
  };


  return (
    <div>
      <form onSubmit={LoginUser}>
        <table>
          <tbody>
            

            <tr>
              <td><label>Email:</label></td>
              <td><input type="email" value={email} onChange={(e) => setEmail(e.target.value)} placeholder="Enter your Email" /></td>
            </tr>

            <tr>
              <td><label>Password:</label></td>
              <td><input type="password" value={password} onChange={(e) => setPassword(e.target.value)} placeholder="Enter your pasword" /></td>
            </tr>

            <tr>
              <td><button type="submit">Login User</button></td>
            </tr>
          </tbody>
        </table>
      </form>
    </div>
  );
}

export default UserLoginForm;
